import React from "react";
import "./Footer.css";
import TypeWriterEffect from 'react-typewriter-effect';

const Footer = () => {
 

  return (
    <footer>
      <div className="footer-content">
        <div className="logo"></div>

        <p>2022 - Foxes Timereport </p>
      </div>
      <div className="footer-bottom">
        <div className="typing">
          <TypeWriterEffect
            
            startDelay={2000}
            cursorColor="#3F3D56"
            multiText={[
                "Hey there, we are the foxes",
              "Oliver",
              "Rasmus",
              "Pontus",
              " and Wilhelm",
            ]}
            loop={true}
            nextTextDelay={1000}
            typeSpeed={30}
          />
        </div>

        <p>copyright @ </p>
      </div>
    </footer>
  );
};

export default Footer;
